import React from 'react';
import Typed from 'react-typed';

const Home = () => {
  return (
    <div className='text-[#000000]'>
        <img src='https://res.cloudinary.com/ddei3mzex/image/upload/v1694210974/fash_qqif6b.jpg' alt='/fash'
            className='w-full h-full object-cover'/>
      <div className='max-w-[800px] mt-[-96px] w-full h-full mx-auto text-center flex flex-col justify-center'>
        <p className='text-[#040707] font-bold p-2'>
          First Impression Matters
        </p>
        <div className='flex justify-center items-center'>
          <p className='md:text-5xl sm:text-4xl text-xl font-bold py-4 text-[#59c8c8]'>
            We'll get you Fresh on
          </p>
          <Typed
          className='md:text-5xl sm:text-4xl text-xl font-bold md:pl-4 pl-2 text-green-500'
            strings={['STYLE', 'SWAG', 'LOOKS']}
            typeSpeed={120}
            backSpeed={140}
            loop
          />
        </div>
        <p className='md:text-2xl text-xl font-bold text-gray-500'>Indeed Fashion is the armor to survive the reality of everyday life.</p>
        <button className='bg-[#00df9a] w-[200px] rounded-md font-medium my-6 mx-auto py-3 text-black'>Get Started</button>
      </div>
    </div>
  );
};

export default Home;
